Enums can be C-like: enum Noun { Person, Place, Thing
} Or they can be more like Haskell's sum types: #[derive(Debug)]
struct Person { name: String
} #[derive(Debug)]
struct Place { name: String, latitude: f32, longitude: f32,
} #[derive(Debug)]
