} fn main() { let thing = Thing { description: "A broken can opener".to_string() }; let mut noun = Noun::Thing(thing); println!("{:#?}", noun); match &mut noun { Noun::Thing(thing) => { thing.description = "A can't opener".to_string() } _ => {} } println!("{:#?}", noun);
}

